import React from "react";
import "./style.css";
import Searchbar from "./Searchbar";
import Movielist from "../Movielist/Movielist";

function Mainpage({ movieData, search, handleInput }) {
  return (
    <div className="mainpage">
      <Searchbar />
      <Movielist />
    </div>
  );
}

export default Mainpage;
